var mixin={methods:{isSupportEnglish(){return this.$getConfiguration("SupportMultiLanguage")},isSupportPassengerListDetail(){return this.$getConfiguration("SupportPassengerListDetail")}},computed:{isDisableEnglish(){return!this.isSupportEnglish()},isEnableEnglish(){return this.isSupportEnglish()}}};Vue.mixin(mixin);